import React from 'react';
import Nav from 'react-bootstrap/Nav';
import lang from '../lang/en.json';
import profile from '../assets/profile.jpeg';
import NavbarScript from '../scripts/Navbar';

export default function Navbar() {
  useEffect(() => {
    const script = document.createElement('script');
    script.src = '/path/to/resource.js';
    script.async = true;
    document.body.appendChild(script);
    return () => {
      document.body.removeChild(script);
    };
  }, []);

  return (
    <div className="nav-container">
      <div className="nav-logo">
        <img src={profile}></img>
        <a href="/">{lang.nebilsahin}</a>
      </div>
      <div className="nav-links">
        <Nav
          activeKey="/home"
          // onSelect={(selectedKey) => alert(`selected ${selectedKey}`)}
        >
          <Nav.Item class="menu-button">
            <div>Menu</div>
            <div class="menu-line"></div>
          </Nav.Item>
          <Nav.Item>
            <Nav.Link className="link-top" href="/home">
              {lang.home}
            </Nav.Link>
          </Nav.Item>
          <Nav.Item>
            <Nav.Link className="link-bottom" eventKey="link-1">
              {lang.skills}
            </Nav.Link>
          </Nav.Item>
          <Nav.Item>
            <Nav.Link className="link-top" eventKey="link-2">
              {lang.projects}
            </Nav.Link>
          </Nav.Item>
          <Nav.Item>
            <Nav.Link className="link-bottom" eventKey="link-2">
              {lang.about}
            </Nav.Link>
          </Nav.Item>
          <Nav.Item>
            <Nav.Link className="link-top" eventKey="link-2">
              {lang.contact}
            </Nav.Link>
          </Nav.Item>
        </Nav>
      </div>
    </div>
  );
}
